    enum ResStatus { FreshDead, Acolyte, LichCandidate, Lich } // FreshDead 1-2months, age2 2-4months, LichCandidate 4-6months, Lich 6+months

    // Integers necessary for project
    uint8 private tknPerTx = 10; // Max mint amount of tokens per transaction
    uint8 private tknReserved = 33; // Max amount of tokens to be minted for community wallet
    uint8 private tknMaxPerWallet = 0; // Max amount of tokens allowed per wallet, if set to 0 no limit
    uint8 private tknMaxPerWalletPre = 33; // Max amount of tokens allowed per wallet during premint sale
    uint8 private addrPreAmnt = 0; // Counter to track amount of tokens minted for specific address
    uint8 private addrPreCount = 0;
    uint8 private artistCut = 34; // Artist % cut of public sale profits, base 100
    uint8 private devCut = 18; // Developer % cut of public sale profits, base 100
    uint8 private managerCut = 18; // Manager 1 % cut of public sale profits, base 100
    uint8 private manager2Cut = 18; // Manager 2 % cut of public sale profits, base 100
    uint8 private communityCut = 10; // Community wallet % cut of public sale profits, base 100
    uint8 private staffCut = 2; // Project staff % cut of public sale profits, base 100
    uint16 constant private tknTotal = 3333; // Max amount of tokens to be minted and created
    uint16 private tokenSlotLength = 0;
    uint256 private tokenPrice = 0.033 ether;
    uint256 constant public resTimersBlckThrshld = 2678400; // 31 days = 2678400

    // Booleans used for checks within project and to gate when certain actions are avialable
    bool private isActive;
    bool private isPreActive;
    bool private isRegisterActive;
    bool private reserveClaimed;
    bool private tknsReserved;
    bool private tknsAdded;

    // Hardcoded address for fund withdrawal from contract
    address artist = 0x64486A4dD7a7feF621f139FD92DF2c40Feb73865;    // Artist Main Wallet // TDoji
    address developer = 0xA3502bd7F1B21bbb05D0D559CD3Efc102Badcf44; // Developer Main Wallet // U4Anthony
    address community = 0x0b3Ce69168f75A4f1793df846CFF34F6C7F67809; // Community Project Wallet
    address manager = 0x70c7C137Db8187c9d7A7d3ebFDE21A7534D98457;   // Project Manager Main Wallet // Pep5k
    address manager2 = 0x75396196461B3Be78339cf874053370383c910e0;  // Project Manager 2 Main Wallet // Ixon
    address staff = 0xAd2245c5b1c0A6a9188CFCeF96767ad13a474495;     // Project Staff Main Wallet // Sumner

    // Arrays and Mappings to be utilized
    uint16[tknTotal] private availableTkns;
    address[] addrRegisteredList;
    mapping(address => preAddrRegistration) private addrRegistered;
    mapping(uint256 => ResTimer) private resTimers;

    // Strings to be utilized
    string private uri;
    string private metaDataExtension = ".json";

    // Base Constructor
    constructor() ERC721("Skullboys", "SKB") {}

    // @dev Allows the baseURI to be set dynamically
    function setBaseURI(string memory _uri) external onlyDev {
      uri = _uri;
    }
    // @dev Returns the current baseURI value
    function getBaseURI() external view returns (string memory) {
      return uri;
    }
    // @dev Sets an individual token URI
    function tokenURI(uint256 tokenId) public override(ERC721) view returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return bytes(uri).length > 0 ? string(abi.encodePacked(uri, tokenId.toString(), metaDataExtension) ) : "";
    }

    // @dev Allows for Ether funds to be wtihdrawn from the contract
    function withdraw() external payable onlyDev {
      uint256 _totalBalance = address(this).balance;
      uint256 managerPayment = (_totalBalance * managerCut) / 100;
      console.log("pay the manager now: ",managerPayment);
      uint256 devPayment = (_totalBalance * devCut) / 100;
      console.log("pay the dev now: ",devPayment);

      Address.sendValue(payable(artist),   (_totalBalance * artistCut) / 100);
      Address.sendValue(payable(developer), (_totalBalance * devCut) / 100);
      Address.sendValue(payable(manager),   (_totalBalance * managerCut) / 100);
      Address.sendValue(payable(manager2),  (_totalBalance * manager2Cut) / 100);
      Address.sendValue(payable(staff),     (_totalBalance * staffCut) / 100);
      Address.sendValue(payable(community), (_totalBalance * communityCut) / 100);

      console.log("start withdraw",_totalBalance, "end of withdraw",address(this).balance);
    }

    // @dev Return Token Skullboyz status
    function getResTimer(uint256 _tknId) public view returns (ResTimer memory) {
      require(_exists(_tknId) == true, "Token not yet minted");
      return resTimers[_tknId];
    }

    // @dev Get the Resurrection timer start time
    function getResTimerStartTime(uint256 _tknId) public view returns (uint256) {
      require(_exists(_tknId)  == true , "Token not yet minted");
      return resTimers[_tknId].clockOrigin;
    }

    // @dev Calculate the Resurrection timer status
    function calcResStatus(uint256 _tknId) public view returns (ResTimer memory) {
      require(_exists(_tknId)  == true , "Token not yet minted");
      ResTimer memory currentStatus = ResTimer({ clockOrigin: resTimers[_tknId].clockOrigin, skullStatus: ResStatus.FreshDead, resurrected: resTimers[_tknId].resurrected});
      currentStatus.clockOrigin = resTimers[_tknId].clockOrigin;
      if ((block.timestamp >= ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 6))))) {
        currentStatus.skullStatus = ResStatus.Lich;
      } else {
        if ((block.timestamp > ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 4))))) {
          currentStatus.skullStatus = ResStatus.LichCandidate;
          } else {
            if ((block.timestamp > ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 2))))) {
