      require(_exists(_tknId) == true, "Token not yet minted.");
      if ((block.timestamp >= ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 6)))) && (resTimers[_tknId].skullStatus != ResStatus.Lich)) {
        resTimers[_tknId].skullStatus = ResStatus.Lich;
      } else {
        if ((block.timestamp > ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 4)))) && (resTimers[_tknId].skullStatus != ResStatus.Lich)) {
          resTimers[_tknId].skullStatus = ResStatus.LichCandidate;
        } else {
          if ((block.timestamp > ((resTimers[_tknId].clockOrigin + (resTimersBlckThrshld * 2))))  && (resTimers[_tknId].skullStatus != ResStatus.Acolyte)) {
            resTimers[_tknId].skullStatus = ResStatus.Acolyte;
          } else {
            if (resTimers[_tknId].skullStatus != ResStatus.FreshDead) {
              resTimers[_tknId].skullStatus = ResStatus.FreshDead;
            }
          }
        }
      }
      return resTimers[_tknId].skullStatus;
    }

    // @dev get the resurrection status of a skullboy
    function getResurrection(uint256 _tknId) public view returns (bool) {
      require(_exists(_tknId) == true, "Token not yet minted");
      return resTimers[_tknId].resurrected;
    }

    // @dev update the resurrection when a skullboy is put in for vinyl redeem
    function updateResurrection(uint256 _tknId) private onlyDev {
      require(resTimers[_tknId].resurrected == false, "Skullboy has already been resurrected.");
      require(getResStatus(_tknId) == ResStatus.Lich, "This Skullboy does not have the required power to be resurrected.");
      resTimers[_tknId].resurrected = true;
    }

    // update timestamp on creation and transfer
    function updateResTimer(uint256 _tknId) private {
      if (resTimers[_tknId].clockOrigin == 0) {
          resTimers[_tknId] = ResTimer({ skullStatus: ResStatus.FreshDead, clockOrigin: block.timestamp, resurrected: resTimers[_tknId].resurrected });
      } else {
        resTimers[_tknId].clockOrigin = block.timestamp;
        resTimers[_tknId].skullStatus = ResStatus.FreshDead;
      }
    }

    // @dev Single Token Mint
    function singleMint() public payable isUser {
      require(tknsAdded, "Tokens not yet added.");
      uint256 _supply = totalSupply();
      require(isActive == true || isPreActive == true, "Presale/Sale is not currently active.");
      require(_supply < tknTotal, "All tokens have been minted.");
      require((_supply + 1) <= tknTotal, "Mint amount would exceed total token supply.");
      require(msg.value == tokenPrice, "ETH amount incorrect.");
      if (isPreActive == true) {
        require(addrRegistered[msg.sender].registered == true, "You are not registered for presale.");
        if (tknMaxPerWalletPre > 0) {
          require(addrRegistered[msg.sender].amntMinted + 1 <= tknMaxPerWalletPre, "The requested mint amount would cause you to exceed the presale total allowed.");
        }
        addrRegistered[msg.sender].amntMinted = addrRegistered[msg.sender].amntMinted + 1;
      }
      uint256 _tknId = getTknToClaim();
      _safeMint(msg.sender, _tknId);
      updateResTimer(_tknId);
    }

    // @dev Multiple Token Mint
    function multipleMint(uint8 _tknAmnt) public payable isUser {
      require(tknsAdded, "Tokens not yet added.");
      uint256 _supply = totalSupply();
      require(isActive == true || isPreActive == true, "Presale/Sale is not currently active.");
      require(_supply < tknTotal, "All tokens have been minted.");
      require((_supply + _tknAmnt) <= tknTotal, "Mint amount would exceed total token supply.");
      require(msg.value == (_tknAmnt * tokenPrice), "ETH amount incorrect.");
      if (tknPerTx > 0) {
        require(_tknAmnt <= tknPerTx && _tknAmnt > 0, "Mint amount must be greater than 0, and must be less than or requal to the max mint per transaction amount." );
      }
      if (isPreActive == true) {
        require(addrRegistered[msg.sender].registered == true, "You are not registered for presale.");
        if (tknMaxPerWalletPre > 0) {
          require(addrRegistered[msg.sender].amntMinted + _tknAmnt <= tknMaxPerWalletPre, "The requested mint amount would cause you to exceed the presale total allowed.");
        }
        addrRegistered[msg.sender].amntMinted = addrRegistered[msg.sender].amntMinted + _tknAmnt;
      }
      for (uint8 i; i < _tknAmnt; i ++){
