      isActive = !isActive;
      isPreActive = false;
    }
    // @dev Get Public Mint State
    function getActiveState() external onlyDev view returns (bool) {
      return isActive;
    }
    // @dev Enable/Disable Presale Minting
    function flipPreActiveState() external onlyDev {
      isPreActive = !isPreActive;
      isActive = false;
    }
    // @dev Get Presale Minting State
    function getPreActiveState() external onlyDev view returns (bool) {
      return isPreActive;
    }
    // @dev Enable/Disable Registration
    function flipRegisterState() external onlyDev {
      isRegisterActive = !isRegisterActive;
    }
    // @dev Get Registration State
    function getRegisterState() external onlyDev view returns (bool) {
      return isRegisterActive;
    }

    function getAvailableSupply() public view returns (uint16) {
        return tokenSlotLength;
    }

    // Initialize tokens. currently initializes array slot with a uint128 tokenId
    function addAvailableTkns(uint8 _from) public {
      require(tokenSlotLength==0,"can only initialize an empty array");
      require(_from < 2,"can only start with zero or one based token ids");
      uint16 offset = _from; // token id is one based
      for(uint16 i=0;i<tknTotal;i++) {
        availableTkns[i]=i+offset;
        // [0] = 1
        // [1] = 2
      }
      // set tokenSlotLength to supply
      tokenSlotLength = tknTotal;
      tknsAdded = true;
    }

    // claim a single token. Claimed tokens are removed from the array
    function getTknToClaim() public returns (uint16) {
      require(tokenSlotLength > 0, "no more tokens available.");
      // generate a random slot and obtain id (or token object)
      uint256 rmd = getRndmNmbr(tokenSlotLength);
      uint16 tokenId = availableTkns[rmd];
      availableTkns[rmd] = availableTkns[tokenSlotLength-1]; // move the last token into the now available slot
      availableTkns[tokenSlotLength-1] = 0;  //zero out the retrieved token slot
      tokenSlotLength--; // decrement the array length counter
      return tokenId;
    }

    // @dev Generate pseudorandom number
    function getRndmNmbr(uint256 _upper) private view returns (uint256) {
      uint256 rndm = uint256(keccak256(abi.encodePacked(availableTkns.length, blockhash(block.number - 1), block.coinbase, block.difficulty, msg.sender)));
      return rndm % _upper;
    }

    // Overrides for Transfer functions for ressurection timer
    function transferFrom(address from, address to, uint256 tokenId) public override {
      super.transferFrom(from, to, tokenId);
      updateResTimer(tokenId);
    }
    function safeTransferFrom(address from, address to, uint256 tokenId,  bytes memory _data) public override {
      super.safeTransferFrom(from, to, tokenId, _data);
      updateResTimer(tokenId);
    }
    // The following functions are overrides required by Solidity.
    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }
    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

}
